import React from "react";

import { Game, initialGame } from './game_logique'


export type ButtonRestartProps = {
  onButtonClick: (game: Game) => void;
};

const ButtonRestart: React.FC<ButtonRestartProps> = ({onButtonClick}) => {
    return (
    <button onClick={() => onButtonClick(initialGame)} children="Reset"></button>
  );
};

export default ButtonRestart;
